Это одно из крупнейших нефтегазовых компаний, которая добывает черное золото на суше и на море. Основные месторождения находятся на шельфе Великобритании. А именно:

Фортисе;
Бакане;
Найниане;
Маснусе;
Дорсете;
Лестершире;
Линкольншире.

@А'Рап Полукоровин А зачем тогда платить в виде налогов тому, кто не обслуживает? Китайцы уже до обслуживались, собственный кислород сожгли - от нехватки кислорода и страдают. У них на 1 жителя в больших городах, по видимому уже менее 5 квадратных сантиметров приходится. Люди не могут в такой плотности жить и развиваться. Это не развитие - а скорейшая смерть.
Бессмыслена ? Ну я бы не говорил на твоём месте. Смысла не видит тот, кто не знает что делать. А это уже диагноз. Надо видеть что необходимо менять, тогда и смысл появится. 
Какая там цифровая индустрия... Не смеши БОЖЬИ тапки. А то они и так от смеха уже "ЕСТЬ" хотят.
